Hell Yeah #1 [IMAGE Comics]

THE LAST GENERATION OF HEROES IS HERE!
Twenty years ago, the first ever superheroes debuted without warning and forever altered our global culture! Now, the generation born in their wake fight to claim their place in a world evolved beyond them! Written by Eisner &amp; Harvey award-winner JOE KEATINGE and illustrated by ELEPHANTMEN and POPGUNs ANDRE SZYMANOWICZ, HELL YEAH combines the over the top excitement of the original Image Comics launch with modern, innovative storytelling. It all begins with a giant-sized first issue containing a full thirty-two pages of story.


